    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
};


const Header = () => (
    <div style={{ display: 'flex', flexDirection: 'row' }}>
        <h5>Tracker</h5>
        <h5>News</h5>
    </div>
)

export default function Layout({ children }) {
    return (
        <div style={layoutStyle}>
            <Header />
            {children}
        </div>
    )
}
